// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "./BuildingStats.sol";

contract GenerateCity is BuildingStats {

    uint private salt;

    constructor() {
        salt = 0;
    }

    function random(uint max) internal returns(uint) {
        uint rand = uint(keccak256(abi.encodePacked(
            salt,
            block.timestamp,
            block.difficulty,
            salt * salt,
            msg.sender
        ))) % max + 1;
        
        salt++;

        return rand;
    }

    struct BuildingProbability {
        uint[] probability;
        uint[] num;
    }

    function getProbabilities() pure private returns(BuildingProbability[] memory) {
        BuildingProbability[] memory prob = new BuildingProbability[](10);
        prob[0] = BuildingProbability(new uint[](1), new uint[](1));
        prob[0].probability[0] = 1;
        prob[0].num[0] = 1;

        prob[1] = BuildingProbability(new uint[](1), new uint[](1));
        prob[1].probability[0] = 1;
        prob[1].num[0] = 1;

        prob[2] = BuildingProbability(new uint[](1), new uint[](1));
        prob[2].probability[0] = 1;
        prob[2].num[0] = 0;

        prob[3] = BuildingProbability(new uint[](1), new uint[](1));
        prob[3].probability[0] = 1;
        prob[3].num[0] = 0;

        prob[4] = BuildingProbability(new uint[](2), new uint[](2));
        prob[4].probability[0] = 19;
        prob[4].num[0] = 1;
        prob[4].probability[1] = 1;
        prob[4].num[1] = 2;

        prob[5] = BuildingProbability(new uint[](3), new uint[](3));
        prob[5].probability[0] = 90;
        prob[5].num[0] = 3;
        prob[5].probability[1] = 9;
        prob[5].num[1] = 4;
        prob[5].probability[2] = 1;
        prob[5].num[2] = 5;

        prob[6] = BuildingProbability(new uint[](2), new uint[](2));
        prob[6].probability[0] = 9;
        prob[6].num[0] = 1;
        prob[6].probability[1] = 1;
        prob[6].num[1] = 2;

        prob[7] = BuildingProbability(new uint[](2), new uint[](2));
        prob[7].probability[0] = 49;
        prob[7].num[0] = 0;
        prob[7].probability[1] = 1;
        prob[7].num[1] = 1;

        prob[8] = BuildingProbability(new uint[](2), new uint[](2));
        prob[8].probability[0] = 7;
        prob[8].num[0] = 1;
        prob[8].probability[1] = 3;
        prob[8].num[1] = 2;

        prob[9] = BuildingProbability(new uint[](2), new uint[](2));
        prob[9].probability[0] = 49;
        prob[9].num[0] = 0;
        prob[9].probability[1] = 1;
        prob[9].num[1] = 1;

        return prob;
    }

    function pickBuildings(BuildingProbability[] memory probabilities) private returns(uint[] memory) {

    }

    event Probabilities(BuildingProbability[] prob);

    function generateRandomBuildings(mapping(uint => Building) storage buildings) internal returns(uint) {
        // uint[] memory number = pickBuildings(getProbabilities());
        emit Probabilities(getProbabilities());
        return 0;
    }
}
